DROP DATABASE bdd;
CREATE DATABASE bdd;

USE bdd;

DROP TABLE IF EXISTS AVION;
CREATE TABLE AVION(	
    immatricule INTEGER PRIMARY KEY,
	nom VARCHAR(10),
	constructeur VARCHAR(30),
    capacite INTEGER CHECK (capacite > 0),
    nombre_reacteurs INTEGER CHECK (nombre_reacteurs > 0),
    largeur INTEGER
);

DROP TABLE IF EXISTS VOL;
CREATE TABLE VOL(
    id INTEGER PRIMARY KEY,
    designation VARCHAR(100),
    ville_origine CHAR(10) REFERENCES VILLE(code_postal),
    ville_arrivee CHAR(10) REFERENCES VILLE(code_postal),
    avion INTEGER REFERENCES AVION(immatricule),
    date_depart DATE,
    date_arrivee DATE,
    duree INTEGER
);

DROP TABLE IF EXISTS VILLE;
CREATE TABLE VILLE(
    nom VARCHAR(100),
    code_postal CHAR(10) PRIMARY KEY
);

DROP TABLE IF EXISTS PASSAGER;
CREATE TABLE PASSAGER(
    id INTEGER PRIMARY KEY,
    nom VARCHAR(80),
    prenom VARCHAR(80),
    poids INTEGER,
    vol INTEGER REFERENCES VOL(id)
);



SELECT nom, capacite from AVION where capacite > 200 and capacite < 300 ORDER BY capacity asc;

select sum(poids) as kg, sum(poids)*1000 as g from PASSAGER WHERE vol = 16;

select max(id) from VOL;
select code_postal from VILLE where nom='Madison';

